import React from "react";
// DATA Files
import dataNavbar from "data/Navbar/home-business-navbar.json";
import dataPortfolio from "data/Portfolio/main-portfolio-data.json";
import dataClients from "data/Clients/clients-data.json";
// Images
import imgTitle from "assets/images/title-bg/title-bg-5.jpg";
// Components
import HeaderSocial from "webapp/work/component/HeaderSocial";
import PageTitleOne from "webapp/work/component/PageTitleOne";
import PortfolioOne from "webapp/common/component/Portfolio/PortfolioOne";
import FooterOne from "webapp/common/component/Footer/FooterOne";
import ClientsCarousel from "webapp/common/component/Carousel/ClientsCarousel";

const WorkPage = () => (
  <>
    <HeaderSocial data={dataNavbar} />
    <PageTitleOne title="Portfolio" image={imgTitle} />
    <PortfolioOne
      data={dataPortfolio}
      filter={true}
      categories={[
        "Branding",
        "Creative Design",
        "Web Design",
        "Stationery",
        "Photography",
      ]}
    />
    <ClientsCarousel data={dataClients} />
    <FooterOne />
  </>
);

export default WorkPage;
